One of my goals for 2024 is to take better care of my curls and stop resisting the urge to straighten my hair. 

My little sister asked my stepmom when she was going to get straight hair like everyone else, broke my heart a little. Put me back to when I was little, resenting having curly hair. Thinking I was ‘messy’ looking bc of little kids being mean. I don’t want my little sister thinking the same. 
Truly thankful for my girl @karolinah_villarreal put me onto @rizoscurls, she also filmed this video with me ♥️📸 

Products used: 
@gisou honey infused hair wash shampoo 
@olaplex hair perfector 
@rizoscurls curl defining cream + mousse + light hold gel 
#rizzocurls #hairroutine #curlyhairroutine #olaplex #gisou #olaplextreatment #easyhairtutorial #hairwashday
